import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import ShengView from '../views/ShengView.vue'
import ShiView from '../views/ShiView.vue'
Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    redirect:'/path/ShiView'
  },
  {
    path: '/path',
    name: 'path',
    component: HomeView
  },
  { 
    path: '/path/ShengView',
    name: 'ShengView',
    component: ShengView
  },
  { 
    path: '/path/ShiView',
    name: 'ShiView',
    component: ShiView
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
